import axios from 'axios';
import { SET_CATEGORIES } from './spotify.types';


export const getCategories = () => async dispatch => {
    try {
        const { data } = await axios.get('/spotify/categories');
        dispatch(setCategories(data))
    } catch (error) {
        console.log(error)
    }
}
